import { useState, useEffect } from "react";
import React from "react";
export const Users = () => {
  const [users, setUsers] = useState([]);
  useEffect(() => {
    fetch("http://localhost:8082/ShoppingCartAdmin/user/getAll")
      .then((res) => res.json())
      .then((result) => {
        setUsers(result);
      });
  }, []);
  console.log(users);
  return (
    <div className="full-details">
      <table className="table table-bordered table-striped table-hover table-reponsive-xl">
        <thead className="thead-dark">
          <tr>
            <th className="hideable-column">User ID</th>
            <th>Photos</th>
            <th className="hideable-column">E-mail</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Roles</th>
            <th>Enabled</th>
            <th>
              <span>Edit</span>
              &nbsp; &nbsp; &nbsp;
              <span>Delete</span>
            </th>
          </tr>
        </thead>
        <tbody>
          {users.map((user, index) => {
            return (
              <tr>
                <td class="hideable-column">{user.id}</td>
                <td>
                  <span class="fa fa-portait fa-3x icon-silver"></span>
                  {/* <img
                    th:if="${user.photos != null}"
                    th:src="@{${user.photosImagePath}}"
                    alt=""
                    style="width: 100px;"
                  /> */}
                </td>
                <td class="hideable-column">{user.email}</td>
                <td>{user.firstName}</td>
                <td>{user.lastName}</td>
                <td>{console.log(2)}</td>
                <td>
                  <div>
                    {/* <a
                      th:if="${user.enabled == true}"
                      th:href="@{'/users/' + ${user.id} + '/enabled/false'}"
                      th:tittle="'Disable this ' + 'user'"
                      class="fas fa-check-circle fa-2x icon-green"
                    ></a> */}
                    <a
                      //   th:if="${user.enabled == false}"
                      //   th:href="@{'/users/' + ${user.id} + '/enabled/true'}"
                      //   th:tittle="'Enabled this ' + 'user'"
                      class="fas fa-circle fa-2x icon-dark"
                    ></a>
                  </div>
                </td>
                <td>
                  <a
                    // th:href="@{'/user/edit/' + ${user.id}}"
                    // th:tittle="'Edit this' + 'user'"
                    class="fas fa-edit fa-2x icon-green"
                  ></a>
                  &nbsp;&nbsp;
                  <a
                    // th:href="@{'/user/delete/' + ${user.id}}"
                    // th:entityId="${user.id}"
                    // th:tittle="'Delete this' + 'user'"
                    class="fas fa-trash fa-2x icon-dark link-delete"
                  ></a>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
};
